sanityChecks.promptOutput:
{
  "hasMaterialIssues": true,
  "overallAssessment": "The tables form a generally coherent inventory and sales model, but several material gaps and inconsistencies could mislead developers, especially around user references, warehouse identifiers, and differing business rules for shipping and discounts.",
  "tableIssues": [
    {
      "tableName": "InventoryAdjustment",
      "issueType": "missing_context",
      "severity": "high",
      "description": "The column 'usr' stores the name of the user who performed the adjustment, but no User (or Employee) master table is defined anywhere in the dependency level, leaving the foreign‑key relationship undefined.",
      "affectedTables": ["InventoryCount", "CustomerNote"],
      "suggestedFix": "Add a User (or Employee) master table and reference it from all tables that contain a 'usr' column, or replace the column with a user_id foreign key."
    },
    {
      "tableName": "InventoryCount",
      "issueType": "missing_context",
      "severity": "high",
      "description": "Same issue as InventoryAdjustment: the 'usr' column references a user name without a defined User entity.",
      "affectedTables": ["InventoryAdjustment", "CustomerNote"],
      "suggestedFix": "Reference a User master table instead of storing free‑text names."
    },
    {
      "tableName": "CustomerNote",
      "issueType": "missing_context",
      "severity": "high",
      "description": "The 'usr' column records the employee who created the note, yet no User/Employee table exists to enforce referential integrity.",
      "affectedTables": ["InventoryAdjustment", "InventoryCount"],
      "suggestedFix": "Introduce a User table and change 'usr' to a foreign key (user_id)."
    },
    {
      "tableName": "Shipment",
      "issueType": "relationship_inconsistency",
      "severity": "medium",
      "description": "The column 'whs_id' is described as \"Warehouse code where the shipment originated\" while the Warehouse master table uses 'whs_id' as the primary key and 'cd' as the three‑letter code. This creates ambiguity about which field the foreign key should reference.",
      "affectedTables": ["Warehouse"],
      "suggestedFix": "Clarify that 'whs_id' references the Warehouse primary key, or rename the column to 'whs_cd' if it should reference the code."
    },
    {
      "tableName": "PurchaseOrder",
      "issueType": "business_logic",
      "severity": "medium",
      "description": "The 'ship_amt' column is limited to values 0 or 150, whereas the SalesOrder table limits 'ship_amt' to 0, 15, or 25. The differing allowed ranges for shipping charges across purchase and sales processes are unexplained and may cause inconsistent financial reporting.",
      "affectedTables": ["SalesOrder"],
      "suggestedFix": "Define a consistent shipping charge policy (e.g., a lookup table) and reference it from both PO and SalesOrder, or document the business rule that justifies the different tiers."
    },
    {
      "tableName": "SalesOrder",
      "issueType": "business_logic",
      "severity": "medium",
      "description": "The order-level discount is stored as a percentage ('disc_pct'), while the line‑item table stores discounts as absolute amounts ('disc'). Without a clear conversion rule, aggregating discounts could be error‑prone.",
      "affectedTables": ["SalesOrderLine"],
      "suggestedFix": "Standardize discount representation (either percentage or amount) across order and line tables, or add explicit conversion logic in the documentation."
    }
  ],
  "crossTableObservations": [
    {
      "observation": "Multiple tables use a generic 'usr' column to capture the acting employee, but no central User/Employee entity exists, leading to fragmented user data and potential integrity issues.",
      "tables": ["InventoryAdjustment", "InventoryCount", "CustomerNote"]
    },
    {
      "observation": "Warehouse identifiers are inconsistently described (primary key vs. short code), which could cause mismatched foreign‑key implementations across Shipment, Receipt, and Inventory tables.",
      "tables": ["Warehouse", "Shipment", "Receipt", "InventoryStatus", "InventoryAdjustment", "InventoryCount"]
    },
    {
      "observation": "Shipping cost fields ('ship_amt' in PO and SalesOrder, 'cost' in Shipment) have different allowed values and naming conventions, indicating a missing unified shipping‑cost model.",
      "tables": ["PurchaseOrder", "SalesOrder", "Shipment"]
    },
    {
      "observation": "Discount handling is split between percentage at the order level and absolute amount at the line level, which may lead to double‑counting or rounding discrepancies.",
      "tables": ["SalesOrder", "SalesOrderLine"]
    }
  ]
}
